utive Officer and Chairman of Tribe.net, a company he launched and one of the first social networks in the industry. From 1997 to 2000, he served as Chairman of Support.com, Inc. (NASDAQ: SPRT), a help desk automation software company he founded, and he served as Chief Executive Officer and President from December 1997 to July 1999. From 1996 to 1997, he served as Chief Executive Officer of FreeLoader, Inc., a web-based news company he founded. Pincus also made founding investments in Napster, Twitter and Facebook. Pincus graduated summa cum laude from University of Pennsylvanias Wharton School of Business and earned an MBA from Harvard Business School. He is an angel investor in multiple Silicon Valley startups and regularly gives lectures to aspiring entrepreneurs.","Investment Focus":"Nutrition, Wellness, Personal Health","LinkedIn Profile":"https://www.linkedin.com/in/markpincus/","Contact Full Name":null,"Total Investments":"64","Family Office City":null,"Portfolio companies":null,"Preferred Geography":"United States","AUM in USD (millions)":null,"Family Office Country":null,"Managing Organization":null,"Number of Investments":"75","Data Validation Period":null,"Secondary Phone Number":null,"Contact Secondary Email":null,"E-Mail  Code Explanation":null,"Personal LinkedIn Address":null,"Data Completion Score (Text)":null,"Family Office State / Region":null,"Family Office Website Address":null,"Data Completion Score (Visual)":null,"Primary E-Mail Validation Code":null,"Secondary E-Mail Validation Code":null,"Email Quality Assessment (Primary)":null,"Data Record Fill Rate (range 0 - 26)":null,"Email Quality Assessment (Secondary)":null}'::jsonb) ON CONFLICT (id) DO UPDATE SET first_name = EXCLUDED.first_name, last_name = EXCLUDED.last_name, email = EXCLUDED.email, title = EXCLUDED.title, stages = EXCLUDED.stages, sectors = EXCLUDED.sectors, is_active = EXCLUDED.is_active, created_at = EXCLUDED.created_at, updated_at = EXCLUDED.updated_at, folk_id = EXCLUDED.folk_i